import React from "react";
import ReactDOM from "react-dom/client";

const galleryImages = [
  "/images/nokalikai.jpg",
  "/images/kaziranga.jpg",
  "/images/weisawdong.jpg"
];


const App = () => (
  <div style={{ textAlign: "center", padding: "20px" }}>
    <h1>Northeast Tour & Travels</h1>
    <p>We offer Cab Booking, Tour Packages, Hotel Bookings</p>
    <p>ðŸ“ž Call us: 7005028948</p>

    <h2 style={{ marginTop: "40px" }}>Gallery</h2>
    <div style={{
      display: "grid",
      gridTemplateColumns: "repeat(auto-fit, minmax(200px, 1fr))",
      gap: "20px",
      maxWidth: "1000px",
      margin: "auto"
    }}>
      {galleryImages.map((url, index) => (
        <img key={index} src={url} alt={`Gallery ${index}`} style={{ width: "100%", borderRadius: "10px" }} />
      ))}
    </div>
  </div>
);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
